import React from 'react';
import './App.css';
import Header from './components/Header';
import Balance from './components/Balance';
import ProfitLoss from './components/ProfitLoss';

function App() {
  return (
    <div>
      <Header />
      <div id='container'>
        <Balance />
        <ProfitLoss />
      </div>
    </div>
  );
}

export default App;
